import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ForgotPasswordComponent } from './Aouth/forgot-password/forgot-password.component';
import { InterfacesComponent } from './Aouth/interfaces/interfaces.component';
import { LoginComponent } from './Aouth/login/login.component';
import { RegisterComponent } from './Aouth/register/register.component';
import { DashBordComponent } from './dash-bord/dash-bord.component';
import { AouthModule } from './Aouth/aouth.module';

@NgModule({
  declarations: [
    AppComponent,
    ForgotPasswordComponent,
    InterfacesComponent,
    LoginComponent,
    RegisterComponent,
    DashBordComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    AouthModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
